import React, { Component } from "react";
import { MDBIcon} from 'mdbreact';
import "./App.css";
import "@fortawesome/fontawesome-free/css/all.min.css";
import "bootstrap-css-only/css/bootstrap.min.css";
import "mdbreact/dist/css/mdb.css";

const formatNumber = (number) => new Intl.NumberFormat("en", { minimumFractionDigits: 2 }).format(number);
class App extends Component {
  render() {
    return (
      <div class="product-list">
        <label>Room Booking</label>
        <div class="main-body">
        <p><MDBIcon icon="users" /><span>Choose number of people</span></p>
        <div class="outer-part">
<div class="rooms"> 
<span class="left-side">
<span> <MDBIcon icon="bed" class="padding-right"/>ROOMS</span>
</span>
<span class="right-side"></span>

</div>
<div class="audults"> 
<span class="left-side">
<span ><MDBIcon icon="user-alt"  class="padding-right"/>ADULTS</span>
</span>
<span class="right-side">
<button class="minus-button">-</button><button class="plus-button">+</button>
</span>
</div>
<div class="children"> 
<span class="left-side">
<span> <MDBIcon icon="child" class="padding-right"/>CHILDREN</span>
</span>
<span class="right-side"></span>
</div>
        </div>
        </div>

    </div>
  );
  }
}

export default App;
